import React from 'react'
import img from '../images/pexels-photo-262978.jpeg'
import { useParams } from 'react-router-dom';
import { useSelector } from 'react-redux';
function Restuarantdetais() {

    const { id } = useParams()
    const resDetails = useSelector((state) => state?.restuarants?.resData?.resData)
    const selRestuarant = resDetails.find((data)=> data._id==id)
   

    return (
        <div className='restuarantDetai'>
            <div className='cnt-left'>
                <img className='detailpage-img' src={img} alt="" />
            </div>
            <div className='cnt-right'>
                <h1>{selRestuarant.resName}</h1>
                <div>
                    <h4>FEATURES</h4>
                    <p>
                    {selRestuarant.features}
                    </p>
                </div>
                <div>
                    <h4>Location</h4>
                    <p>
                      {selRestuarant.location}
                    </p>
                </div>
                <div>
                    <span><b>Type:</b></span> <span>{selRestuarant.location}</span>
                    <div className='nei'><p><b>Neighborhood:</b></p><p>Busstand</p></div>
                </div>

            </div>

        </div>
    )
}

export default Restuarantdetais
